(window.webpackJsonp=window.webpackJsonp||[]).push([[117],{201:function(e){e.exports=JSON.parse('{"id":"implementations/openhie","title":"OpenHIE","sidebar_label":"OpenHIE","description":"OpenHIE is an initiative that aims to provide a reference architecture and workflow specifications for sharing health information between point of care systems in low resource settings. It aims to be standards-based and open such that components of the architecture can be swapped out as is necessary. OpenHIE is made up of a number of sub-communities that each aim to discuss a particular component of the architecture. Each community maintains a reference implementation of their particular component.","source":"@site/docs/implementations/openhie.md","permalink":"/openhim-docs/docs/implementations/openhie","sidebar":"docs","next":{"title":"Setup and configure the OpenHIM","permalink":"/openhim-docs/docs/how-to/setup-and-configure"},"previous":{"title":"MomConnect","permalink":"/openhim-docs/docs/implementations/momconnect"}}')}}]);